@SOUTHBAYxLA This is still a rather small sample size, but Arenado’s wRC+ at Dodger Stadium is 106. It’s 128 at Coors Field.

Just things to keep in mind with Arenado entering his 30s and being owed $199 million through 2026. 

How much money the #Rockies eat/the #Dodgers take on will be key.
